import React from 'react';
import {
  Grid,
  Paper,
  List,
  ListItem,
  ListItemText,
} from '@mui/material';
import CustomImageAvatar from '../components/CustomImageAvatar';
import SwipeableTextMobileStepper from '../components/SwipeableTextMobileStepper.js';
import '../style/HomePage.css';
import avatar from '../images/avatar.png';

function HomePage() {
  return (
    <div className="HomePage">
      <header className="HomePage-header">
      <Grid container justifyContent="center"> {/* Center horizontally */}
                <CustomImageAvatar size={220} imgPath={avatar}></CustomImageAvatar>
              </Grid>
        <Grid container spacing={2} alignItems="center"> {/* Center vertically */}
          <Grid item xs={12} sm={7}>
            <Paper elevation={3} className="avatar-container">

              <SwipeableTextMobileStepper></SwipeableTextMobileStepper>
            </Paper>
          </Grid>

          {/* Right Side - Animated Vertical Menu */}
          <Grid item xs={12} sm={5}>
            <List component="nav" className="vertical-menu">
              <ListItem button className="vertical-menu-item">
                <ListItemText primary="Menu Item 1" className="menu-text"/>
              </ListItem>
              <ListItem button className="vertical-menu-item">
                <ListItemText primary="Menu Item 2" className="menu-text"/>
              </ListItem>
              <ListItem button className="vertical-menu-item">
                <ListItemText primary="Menu Item 3" className="menu-text"/>
              </ListItem>
              {/* Add more menu items as needed */}
            </List>
          </Grid>
        </Grid>
      </header>
    </div>
  );
}

export default HomePage;
